import React from "react";

export const Tile = (name, description) => {
  const decriptions = Object.values(description).map((value,index)=>(
    <p key={value} index={index}></p>
  ));
  return (
    <div className="tile-container">
      <p className="tile-title">{name}</p>
    </div>
  );
};
